package com.function.createPdf;

import com.microsoft.azure.functions.ExecutionContext;
import com.microsoft.azure.functions.HttpMethod;
import com.microsoft.azure.functions.HttpRequestMessage;
import com.microsoft.azure.functions.HttpResponseMessage;
import com.microsoft.azure.functions.HttpStatus;
import com.microsoft.azure.functions.annotation.AuthorizationLevel;
import com.microsoft.azure.functions.annotation.FunctionName;
import com.microsoft.azure.functions.annotation.HttpTrigger;

import java.util.Arrays;
import java.util.Base64;
import java.util.Optional;
import java.util.zip.Deflater;

import javax.imageio.IIOImage;
import javax.imageio.ImageIO;
import javax.imageio.ImageWriteParam;
import javax.imageio.ImageWriter;
import javax.imageio.stream.ImageOutputStream;

import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.ByteArrayOutputStream;
import java.io.FileOutputStream;
import java.io.IOException;
import java.io.InputStream;

import org.apache.pdfbox.pdmodel.PDDocument;
import org.apache.pdfbox.pdmodel.PDPage;
import org.apache.pdfbox.pdmodel.PDPageContentStream;
import org.apache.pdfbox.pdmodel.common.PDRectangle;
import org.apache.pdfbox.pdmodel.graphics.image.PDImageXObject;

/**
 * Azure Functions with HTTP Trigger.
 */
public class Function {
        /**
         * This function listens at endpoint "/api/HttpExample". Two ways to invoke it
         * using "curl" command in bash:
         * 1. curl -d "HTTP Body" {your host}/api/HttpExample
         * 2. curl "{your host}/api/HttpExample?name=HTTP%20Query"
         */
        @FunctionName("CreatePdf")
        public static String run(
                        @HttpTrigger(name = "req", methods = { HttpMethod.GET,
                                        HttpMethod.POST
                        }, authLevel = AuthorizationLevel.ANONYMOUS) HttpRequestMessage<Optional<String>> request,
                        final ExecutionContext context) {
                context.getLogger().info("Java HTTP trigger processed a request.");

                String[] imgArr = new String[] {
                                "",
                                ""
                };

                String base64Str = "";
                // Creating PDF document object
                PDDocument doc = new PDDocument();
                try {

                        for (int i = 0; i < imgArr.length; i++) {
                                // Creating a blank page
                                PDPage blankPage = new PDPage();

                                // Adding the blank page to the document
                                doc.addPage(blankPage);

                                for (int j = 0; j <= i; j++) {
                                        // System.out.println(i + " " + "data:image/png;base64," + imgArr[i]);
                                        // String base64Str = imgArr[i].split(,)[1];
                                        // byte[] decoded = java.util.Base64.getDecoder().decode(imgArr[i]);
                                        // System.out.println(decoded);

                                        // Retrieving the page
                                        PDPage page = doc.getPage(i);

                                        if (imgArr[j].charAt(0) == '/' || imgArr[j].charAt(0) == '!') {

                                                // decode the base64 encoded image string
                                                byte[] decoded = java.util.Base64.getDecoder().decode(imgArr[j]);

                                                ByteArrayOutputStream compressed = new ByteArrayOutputStream();
                                                ImageIO.setUseCache(false); // because we write into ram here

                                                InputStream is = new ByteArrayInputStream(decoded);
                                                BufferedImage bi = ImageIO.read(is);

                                                try (ImageOutputStream outputStream = ImageIO
                                                                .createImageOutputStream(compressed)) {

                                                        // Obtain writer for JPEG format
                                                        ImageWriter imgWriter = ImageIO
                                                                        .getImageWritersByFormatName("JPG").next();

                                                        // Configure compression: 50% quality
                                                        ImageWriteParam imgWriteParam = imgWriter
                                                                        .getDefaultWriteParam();
                                                        imgWriteParam.setCompressionMode(ImageWriteParam.MODE_EXPLICIT);
                                                        imgWriteParam.setCompressionQuality(0.5f);

                                                        // Set in-memory stream as the output
                                                        imgWriter.setOutput(outputStream);

                                                        // Write image as w/configured settings to the in-memory
                                                        // stream
                                                        // (the IIOImage is just an aggregator object, allowing you to
                                                        // associate
                                                        // thumbnails and metadata to the image, it "does" nothing)
                                                        imgWriter.write(null, new IIOImage(bi, null, null),
                                                                        imgWriteParam);

                                                        // Dispose the writer to free resources
                                                        imgWriter.dispose();
                                                } catch (Exception e) {
                                                        System.out.println(e.getMessage());
                                                }

                                                // Get data for further processing...
                                                byte[] imgData = compressed.toByteArray();

                                                // Creating PDImageXObject object
                                                PDImageXObject pdImage = PDImageXObject.createFromByteArray(
                                                                doc, imgData, null);

                                                // PDPageContentStream contentStream = new PDPageContentStream(doc,
                                                // page);
                                                PDPageContentStream contentStream = new PDPageContentStream(doc,
                                                                page, PDPageContentStream.AppendMode.OVERWRITE, true,
                                                                true);

                                                PDRectangle pageSize = PDRectangle.A4;
                                                int originalWidth = pdImage.getWidth();
                                                int originalHeight = pdImage.getHeight();
                                                float pageWidth = pageSize.getWidth();
                                                float pageHeight = pageSize.getHeight();
                                                float ratio = Math.min(pageWidth / originalWidth,
                                                                pageHeight / originalHeight);
                                                float scaledWidth = originalWidth * ratio;
                                                float scaledHeight = originalHeight * ratio;
                                                float x = (pageWidth - scaledWidth) / 2;
                                                float y = (pageHeight - scaledHeight) / 2;

                                                contentStream.drawImage(pdImage, x, y, scaledWidth, scaledHeight);
                                                contentStream.close();

                                                // FileOutputStream fos = new FileOutputStream(
                                                // "C:\\Users\\Hp\\Desktop\\" + "img" + (j + 1) + ".jpg");
                                                // fos.write(decoded);
                                                // fos.flush();
                                                // fos.close();

                                                // System.out.println(imgArr[j] + "\n");

                                        } else {
                                                base64Str = imgArr[j];
                                        }

                                }

                        }

                        ByteArrayOutputStream byteArrayOutputStream = new ByteArrayOutputStream();
                        doc.save(byteArrayOutputStream);

                        if (base64Str.isEmpty()) {
                                // byte[] inFileBytes = Files.readAllBytes(byteArrayOutputStream.toByteArray());
                                byte[] inFileBytes = byteArrayOutputStream.toByteArray();
                                byte[] encoded = java.util.Base64.getEncoder().encode(inFileBytes);
                                base64Str = new String(encoded);

                                // Saving the document
                                // doc.save("C:\\Users\\Hp\\Desktop\\blank.pdf");
                        }

                        // Closing the document
                        doc.close();

                } catch (IOException e) {
                        System.out.println(e.getMessage());
                }

                System.out.println("PDF created");

                // return request.createResponseBuilder(HttpStatus.OK).body("Pdf successfully
                // created").build();

                return base64Str;

        }

}
